import React from 'react';
import './style/style.css'
import linkedin from "../Pages/images/linkedin-image.png";

export const Footer = ()=>
{
    return (

            <div className="footer">
                <div>
                    <div className='footer-p'>Contact me at <a href='mailto:victormegir@gmail.com'>victormegir@gmail.com</a></div>
                    <div className='footer-p'>Find me on LinkedIn as <a href='https://www.linkedin.com/in/victor-megir-246b8b188/'>Victor Megir</a></div>
                    <div className='footer-p'>Find me on GitHub as <a href='https://github.com/VictorMegir'>Victor Megir</a></div>
                </div>

                <div className='link-images'>
                    <a href='https://www.linkedin.com/'><img className='linkedin-image' src={linkedin} alt='T_T'/></a>
                </div>
            </div>

    );
}

export default Footer;
